import styled from "styled-components";

const Father = styled.div`
  display: flex;
`;

const Btn = styled.button`
  color: white;
  background-color: tomato;
  border: 0;
  border-radius: 15px;
`;

const Link = styled(Btn)``;

const App = () => {
  return (
    <Father>
      <Btn></Btn>
      <Btn as="a" href="/">
        Log in
      </Btn>
    </Father>
  );
};

export default App;
